    false,nt"url": null,nt"notes": "This report is a culmination of field,
    laboratory, and bibliographic work begun in August, 1974. The project as originally
    contracted called for a survey of Utah and Colorado species, but at the suggestion
    of Dr. Marc Imlay the survey was expanded to cover the additional states. The task
    grew in terms of area and taxonomic diversity and its objectives were modified to
    best use the time and financial resources available. The project objectives became,
    1) to determine the status of as many species as possible under the Endangered Species
    Act of 1973, 2) to identify those rare, localized mollusks that do not merit threatened
    or endangered status as defined at present (IUCN Rare category), 3) to identify
    present and potential risks to the molluscan fauna, 4) to provide the Office of
    Endangered Species with a reference for future planning and management in the region,
    5) and to recommend taxa, mollusk groups, or geographic areas for further investigation.",nt"owner_org":
